import React, { Component } from "react";
import GamePage from "./GamePage.jsx";

class Game extends Component {
  constructor(props) {
    super(props);
    this.state = {
      details: this.props.game,
    };
  }

  render() {
    return (
      <div>
        <h1>{"Details are " + this.state.details.name}</h1>
      </div>
    );
  }
}

export default Game;
